description:
Set during the time of the first outbreak of bubonic plague in England, a young monk is tasked with learning the truth about reports of people being brought back to life in a small village.

In medieval England fallen under the shadow of the Black Death, a young monk called Osmund is charged in leading a fearsome knight, Ulric and his group of mercenaries to a remote marsh. Their quest is to hunt down a necromancer - someone able to bring the dead back to life...

